package Collections.Set;

import java.util.HashSet;

public class HashSet_Demo1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		HashSet hs = new HashSet();
		
		hs.add("A");
		hs.add('c');
		hs.add(34);
		hs.add(3.145);
		hs.add(true);
		
		System.out.println(hs);
		
	}

}
